import React from 'react';
import { FaPlay, FaPlus } from '../icons';

// Sample playlists data
const samplePlaylists = [
  {
    id: 'playlist1',
    name: 'Top Hits 2023',
    description: 'The most popular songs right now',
    image: 'https://images.weserv.nl/?url=https://i.scdn.co/image/ab67706f00000003e8e28219724c2423afa4d320',
    songs: 50,
    followers: '2.5M'
  },
  {
    id: 'playlist2',
    name: 'Chill Vibes',
    description: 'Relaxing tunes to unwind',
    image: 'https://images.weserv.nl/?url=https://i.scdn.co/image/ab67706f00000003ca5a7517156021292e5663a4',
    songs: 40,
    followers: '1.2M'
  },
  {
    id: 'playlist3',
    name: 'Workout Motivation',
    description: 'Power through your workout with these energetic tracks',
    image: 'https://images.weserv.nl/?url=https://i.scdn.co/image/ab67706f000000035f25dd9540c1e64a7deff7b8',
    songs: 45,
    followers: '980K'
  },
  {
    id: 'playlist4',
    name: 'Acoustic Covers',
    description: 'Beautiful acoustic versions of your favorite songs',
    image: 'https://images.weserv.nl/?url=https://i.scdn.co/image/ab67706f00000003e4eadd5b3a3dd0a7318a5a05',
    songs: 30,
    followers: '750K'
  }
];

// Fixed PlayButton component to avoid undefined component error
const PlayButton = ({ size = 20 }: { size?: number }) => (
  <svg 
    stroke="currentColor"
    fill="currentColor"
    strokeWidth="0"
    viewBox="0 0 448 512"
    height={size}
    width={size}
    xmlns="http://www.w3.org/2000/svg"
    className="text-white"
  >
    <path d="M424.4 214.7L72.4 6.6C43.8-10.3 0 6.1 0 47.9V464c0 37.5 40.7 60.1 72.4 41.3l352-208c31.4-18.5 31.5-64.1 0-82.6z" />
  </svg>
);

const PlaylistsPage: React.FC = () => {
  return (
    <div className="container mx-auto px-6 py-8">
      <h1 className="text-3xl font-bold mb-6">Playlists</h1>

      {/* Featured Playlists */}
      <div className="mb-10">
        <div className="flex justify-between items-center mb-4">
          <h2 className="text-xl font-semibold text-white">Featured Playlists</h2>
          <button className="text-sm font-medium text-purple-400 hover:text-purple-300">
            View All
          </button>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
          {samplePlaylists.map(playlist => (
            <div key={playlist.id} className="glass rounded-lg overflow-hidden transition transform hover:scale-105">
              <div className="relative">
                <img 
                  src={playlist.image} 
                  alt={playlist.name} 
                  className="w-full aspect-square object-cover"
                  onError={(e) => {
                    e.currentTarget.src = 'https://via.placeholder.com/300?text=Playlist';
                  }}
                />
                <div className="absolute inset-0 bg-black bg-opacity-40 opacity-0 hover:opacity-100 transition-opacity flex items-center justify-center">
                  <button className="bg-green-500 rounded-full p-3 transform hover:scale-110 transition">
                    <PlayButton size={20} />
                  </button>
                </div>
              </div>
              <div className="p-4">
                <h3 className="text-white font-bold truncate">{playlist.name}</h3>
                <p className="text-gray-400 text-sm line-clamp-2 h-10">{playlist.description}</p>
                <div className="flex justify-between mt-3">
                  <span className="text-gray-400 text-xs">{playlist.songs} songs</span>
                  <span className="text-gray-400 text-xs">{playlist.followers} followers</span>
                </div>
                <div className="flex justify-between mt-4">
                  <button className="flex items-center text-gray-300 hover:text-white text-sm">
                    <FaPlus size={14} className="mr-1" />
                    Save
                  </button>
                  <button className="flex items-center text-gray-300 hover:text-white text-sm">
                    <FaPlus size={14} className="mr-1" />
                    Add to Queue
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Create Playlist Banner */}
      <div className="glass p-6 rounded-lg bg-gradient-to-r from-indigo-700 to-purple-700">
        <div className="flex flex-col md:flex-row items-center justify-between">
          <div>
            <h3 className="text-xl font-bold mb-2">Create Your Own Playlist</h3>
            <p className="text-gray-300 mb-4 md:mb-0">Craft your perfect collection of tracks to share with friends</p>
          </div>
          <button className="bg-white text-purple-700 px-6 py-3 rounded-full font-bold hover:bg-opacity-90 transition">
            Create Playlist
          </button>
        </div>
      </div>
    </div>
  );
};

export default PlaylistsPage;
